-- 1713914099 UP add-missing-jalisco-cp

SELECT DISTINCT
  sub.id,
  sub.zip_code,
  (SELECT id FROM branchoffice WHERE prefix = 'GDL01') AS branchoffice_id,
  1
FROM suburb sub
WHERE sub.id NOT IN (
    SELECT pc.suburb_id
    FROM parcel_coverage pc
    WHERE pc.branchoffice_id = (SELECT id FROM branchoffice WHERE prefix = 'GDL01')
)
AND sub.county_id IN (1533, 1534, 1540, 1544)
AND sub.suburb_type <> 'Ranchería'
GROUP BY sub.id, sub.zip_code
ORDER BY sub.id, sub.zip_code DESC;